import { configureStore } from "@reduxjs/toolkit";
import counterLogic from "./counterLogic";
import toggleLogic from "./toggleLogic";


export default configureStore({
    reducer: {
    counter: counterLogic,
    toggle: toggleLogic
    },
    });
